// Header.js
import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => (
  <header>
    <h1>My App</h1>
    <nav>
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
      {/* No Router here */}
    </nav>
  </header>
);

export default Header;
